INSERT INTO `oc_modification` (`modification_id`, `extension_install_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('9', '12', 'LIVEOPENCART: Parent-child Options', 'parent-child-options', 'LIVEOPENCART (support@liveopencart.com)', '3.0.3b', 'http://liveopencart.com', '<?xml version="1.0" encoding="utf-8"?>\r\n<modification>\r\n\t<code>parent-child-options</code>\r\n  <name>LIVEOPENCART: Parent-child Options</name>\r\n  <version>3.0.3b</version>\r\n  <author>LIVEOPENCART (support@liveopencart.com)</author>\r\n  <link>http://liveopencart.com</link>\r\n  \r\n  <file path="admin/controller/catalog/product.php">\r\n\t\t\r\n\t\t<!--\r\n\t\t<operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$this->load->language(\'catalog/product\');\r\n\t\t\t]]></search>\r\n      <add position="before"><![CDATA[\r\n        // << Parent-child Options\r\n\t\t\t\t$this->load->language(\'extension/module/parent_child_options\');\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n\t\t-->\r\n    \r\n    <operation>\r\n      <search>\r\n        <![CDATA[function getForm() {]]>\r\n      </search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n        \r\n\t\t\t\t$this->load->model(\'extension/module/parent_child_options\');\r\n\t\t\t\tif ( $this->model_extension_module_parent_child_options->installed() ) {\r\n\t\t\t\t\r\n\t\t\t\t\t$this->document->addScript($this->model_extension_module_parent_child_options->getProductEditPageScriptPath());\r\n\t\t\t\t\t\r\n\t\t\t\t\t$data = array_merge( !empty($data) ? $data : array(), $this->model_extension_module_parent_child_options->getProductPageData() );\r\n\t\t\t\t\r\n        }\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n    <operation>\r\n      <search>\r\n        <![CDATA[$data[\'product_options\'][] = array(]]>\r\n      </search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n        \'pcop\'    => isset($product_option[\'pcop\']) ? $product_option[\'pcop\'] : false,\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n\t\t<operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$option_data[] = array(\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n\t\t\t\t\'pcop_front\'    => isset($product_option[\'pcop_front\']) ? $product_option[\'pcop_front\'] : false,\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n  </file>\r\n  \r\n  <file path="admin/model/catalog/product.php">\r\n    \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\tfunction getProductOptions($product_id\r\n\t\t\t]]></search>\r\n      <add position="before"><![CDATA[\r\n        \r\n        // << Parent-child Options\r\n        \r\n        public function pcop_checkTables() {\r\n          $this->load->model(\'extension/module/parent_child_options\');\r\n\t\t\t\t\t$this->model_extension_module_parent_child_options->checkTables();\r\n        }\r\n        \r\n        public function pcop_getParents($product_option_id) {\r\n          $this->load->model(\'extension/module/parent_child_options\');\r\n\t\t\t\t\treturn $this->model_extension_module_parent_child_options->getProductOptionParents($product_option_id);\r\n        }\r\n              \r\n        // >> Parent-child Options\r\n        \r\n      ]]></add>\r\n    </operation>\r\n    \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$product_option_data[] = array(\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n        \'pcop\' => $this->pcop_getParents($product_option[\'product_option_id\']),\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n\t\t<!--\r\n\t\t\tsome specific modiles update product options (insert) by themselves (like PSO) and add code by vQmod\r\n\t\t\tit is not possible to get product option ids in this case at the first option saving,\r\n\t\t\tbut only on next savings, when product option ids are already known \r\n\t\t-->\r\n\t\t<operation>\r\n      <search><![CDATA[\r\n\t\t\t\tforeach ($data[\'product_option\'] as $product_option) {\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n\t\t\t\t\r\n\t\t\t\tif (__FUNCTION__ == \'addProduct\' || __FUNCTION__ == \'editProduct\') {\r\n\t\t\t\t\tif ( !empty($product_option[\'product_option_id\']) ) {\r\n\t\t\t\t\t\t$pcop_product_option_id = $product_option[\'product_option_id\'];\r\n\t\t\t\t\t\tif ( isset($product_option[\'product_option_temp_id\']) ) {\r\n\t\t\t\t\t\t\t$pcop_temp_ids[\'po\'][$product_option[\'product_option_temp_id\']] = $pcop_product_option_id;\r\n\t\t\t\t\t\t}\r\n\t\t\t\t\t}\r\n\t\t\t\t}\r\n        \r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$this->db->query("INSERT INTO " . DB_PREFIX . "product_option SET\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n        \r\n        if ( !empty($product_option) ) {\r\n          $pcop_product_option_id = $this->db->getLastId();\r\n\t\t\t\t\tif ( isset($product_option[\'product_option_temp_id\']) ) {\r\n\t\t\t\t\t\t$pcop_temp_ids[\'po\'][$product_option[\'product_option_temp_id\']] = $pcop_product_option_id;\r\n\t\t\t\t\t} elseif ( isset($product_option[\'product_option_id\']) ) {\r\n\t\t\t\t\t\t$pcop_temp_ids[\'po\'][$product_option[\'product_option_id\']] = $pcop_product_option_id;\r\n\t\t\t\t\t}\r\n        } \r\n        \r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n\t\t<operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$this->db->query("INSERT INTO " . DB_PREFIX . "product_option_value\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n        \r\n        if ( !empty($product_option_value) ) {\r\n          $pcop_product_option_value_id = $this->db->getLastId();\r\n\t\t\t\t\tif ( isset($product_option_value[\'product_option_value_temp_id\']) ) {\r\n\t\t\t\t\t\t$pcop_temp_ids[\'pov\'][$product_option_value[\'product_option_value_temp_id\']] = $pcop_product_option_value_id;\r\n\t\t\t\t\t} elseif ( isset($product_option_value[\'product_option_value_id\']) ) {\r\n\t\t\t\t\t\t$pcop_temp_ids[\'pov\'][$product_option_value[\'product_option_value_id\']] = $pcop_product_option_value_id;\r\n\t\t\t\t\t}\r\n        } \r\n        \r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n\t\t\r\n\t\t<operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$this->cache->delete(\'product\');\r\n\t\t\t]]></search>\r\n      <add position="before"><![CDATA[\r\n        // << Parent-child Options\r\n        \r\n        if ( (__FUNCTION__ == \'addProduct\' || __FUNCTION__ == \'editProduct\') && isset($data[\'product_option\']) ) {\r\n\t\t\t\t\t$this->load->model(\'extension/module/parent_child_options\');\t\t\t\t\t\r\n\t\t\t\t\t$this->model_extension_module_parent_child_options->setProductOptionsParents($product_id, $data[\'product_option\'], $pcop_temp_ids);\r\n\t\t\t\t} elseif ( __FUNCTION__ == \'deleteProduct\' ) {\r\n\t\t\t\t\t$this->load->model(\'extension/module/parent_child_options\');\t\t\t\t\t\r\n\t\t\t\t\t$this->model_extension_module_parent_child_options->removeProductPCOP($product_id);\r\n\t\t\t\t}\r\n        \r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n    \r\n  </file>\r\n  \r\n  <file path="admin/view/template/catalog/product_form.twig">\r\n    \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t{{ footer }}\r\n\t\t\t]]></search>\r\n      <add position="before"><![CDATA[\r\n        <!-- << Parent-child Options -->\r\n\t\t\t\t{% if ( pcop_installed ?? 0 ) %}\r\n\t\t\t\t\t<script type="text/javascript"><!--\r\n\t\t\t\t\t\r\n\t\t\t\t\t\tpcop.all_product_options = {{ (pcop_all_product_options ?? 0) ? pcop_all_product_options|json_encode : \'false\' }};\r\n\t\t\t\t\t\tpcop.basic_product_options = {{ product_options is defined ? product_options|json_encode : \'{}\' }};\r\n\t\t\t\t\t\tpcop.texts = {{ pcop_texts is defined ? pcop_texts|json_encode : \'{}\' }};\r\n\t\t\t\t\t\tpcop.init( {{ option_row }} );\r\n\t\t\t\t\t\t\r\n\t\t\t\t\t\t{#\r\n\t\t\t\t\t\t{% for i_option_row in 0..option_row %}\r\n\t\t\t\t\t\t\tpcop.showOptionSettings( {{ i_option_row }} );\r\n\t\t\t\t\t\t{% endfor %}\r\n\t\t\t\t\t\t#}\r\n\t\t\t\t\t\t\r\n\t\t\t\t\t//--></script>\r\n\t\t\t\t{% endif %}\r\n        <!-- << Parent-child Options -->\r\n      ]]></add>\r\n    </operation>\r\n    \r\n    \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$(\'#tab-option .tab-content\').append(html);\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n\t\t\t\t// << Parent-child Options\r\n\t\t\t\t{% if ( pcop_installed ?? 0 ) %}\r\n\t\t\t\t\tpcop.showOptionSettings(option_row);\r\n\t\t\t\t{% endif %}\t\r\n\t\t\t\t// >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n\t\t<operation error="skip">\r\n      <search><![CDATA[\r\n\t\t\t\t<input type="hidden" name="product_option[{{ option_row }}][product_option_value][{{ option_value_row }}][product_option_value_id]" value="{{ product_option_value.product_option_value_id }}" />\r\n\t\t\t]]></search>\r\n      <add position="before"><![CDATA[\r\n\t\t\t\t{# // << Parent-child Options #}\r\n\t\t\t\t{% if ( (pcop_installed ?? false) and (product_option_value.product_option_value_temp_id ?? false) ) %}\r\n\t\t\t\t\t<input type="hidden" name="product_option[{{ option_row }}][product_option_value][{{ option_value_row }}][product_option_value_temp_id]" value="{{ product_option_value.product_option_value_temp_id }}" />\r\n\t\t\t\t{% endif %}\t\r\n\t\t\t\t{# // >> Parent-child Options #}\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n  </file>\r\n  \r\n  <file path="catalog/controller/product/product.php"> \r\n    \r\n\t\t<operation>\r\n      <search><![CDATA[\r\n\t\t\t\tpublic function index() {\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n\t\t\t\t\r\n\t\t\t\tif ( !$this->parent_child_options_common ) {\r\n\t\t\t\t\t$this->load->library(\'liveopencart/parent_child_options_common\');\r\n\t\t\t\t}\r\n\t\t\t\tif ( $this->parent_child_options_common->installed() ) {\r\n\t\t\t\t\t$this->document->addScript($this->parent_child_options_common->getProductPageScriptPath());\r\n\t\t\t\t}\r\n        \r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\tforeach ($this->model_catalog_product->getProductOptions(\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n        if ( !isset($pcop_data) ) $pcop_data = array();\r\n        $pcop_data[$option[\'product_option_id\']] = isset($option[\'pcop_front\']) ? $option[\'pcop_front\'] : array();\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$data[\'reviews\']\r\n\t\t\t]]></search>\r\n      <add position="before"><![CDATA[\r\n        // << Parent-child Options\r\n        $data[\'pcop_data\'] = !empty($pcop_data) ? $pcop_data : array();\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n    <operation>\r\n      <search>\r\n        <![CDATA[$data[\'product_id\'] =]]>\r\n      </search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n\t\t\t\tif ( !$this->parent_child_options_common ) {\r\n\t\t\t\t\t$this->load->library(\'liveopencart/parent_child_options_common\');\r\n\t\t\t\t}\r\n        $data[\'pcop_theme_name\'] = $this->parent_child_options_common->getThemeName();\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n  </file>\r\n  \r\n  <file path="catalog/model/catalog/product.php|admin/model/catalog/product.php">\r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\tpublic function getProduct($product_id) {\r\n\t\t\t]]> </search>\r\n      <add position="before"><![CDATA[\r\n        // << Parent-child Options\r\n        function pcop_front_getProductOptionParents($product_option_id) {\r\n\t\t\t\t\tif ( !$this->parent_child_options_common ) {\r\n\t\t\t\t\t\t$this->load->library(\'liveopencart/parent_child_options_common\');\r\n\t\t\t\t\t}\r\n\t\t\t\t\treturn $this->parent_child_options_common->getProductOptionFrontParents($product_option_id);\r\n\t\t\t\t}\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t\'product_option_id\'    => $product_option[\'product_option_id\'],\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n        \'pcop_front\'    => $this->pcop_front_getProductOptionParents($product_option[\'product_option_id\']),\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n  </file>\r\n\t\r\n\t<!--\r\n\t<file path="catalog/view/theme/*/template/product/product.twig|admin/view/template/sale/order_form.twig">\r\n\t-->\r\n\t<file path="catalog/view/theme/*/template/product/product.twig">\r\n    <operation>\r\n      <search regex="true"><![CDATA[~({{[ ]*footer[ ]*}})~]]></search>\r\n      <add position="before"><![CDATA[\r\n        {% if ( pcop_data ?? false ) %}\r\n\t\t\t\t\t<!-- << Parent-child Options -->\r\n\t\t\t\t\t<script type="text/javascript"><!--\r\n\t\t\t\t\t\r\n\t\t\t\t\t\tvar pcop_data = {{ (pcop_data ?? 0) ? pcop_data|json_encode : \'[]\' }};\r\n\t\t\t\t\t\tvar pcop_theme_name = \'{{ pcop_theme_name ?? \'\' }}\';\r\n\t\t\t\t\t\t\r\n\t\t\t\t\t\tif ( typeof(pcop_front) != \'undefined\' ) {\r\n\t\t\t\t\t\t\tpcop_front.init(pcop_data, pcop_theme_name);\r\n\t\t\t\t\t\t}\r\n\t\t\t\t\t\r\n\t\t\t\t\t//--></script>\r\n\t\t\t\t\t<!-- >> Parent-child Options -->\r\n        {% endif %}\r\n\t\t\t\t$1\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n  </file>\r\n\t\r\n\t<file path="admin/controller/sale/order.php">\r\n    \r\n\t\t<operation>\r\n      <search><![CDATA[\r\n\t\t\t\tpublic function getForm(\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n\t\t\t\tif ( !$this->parent_child_options_common ) {\r\n\t\t\t\t\t$this->load->library(\'liveopencart/parent_child_options_common\');\r\n\t\t\t\t}\r\n\t\t\t\tif ( $this->parent_child_options_common->installed() ) {\r\n\t\t\t\t\t$this->document->addScript($this->parent_child_options_common->getProductPageScriptPath());\r\n\t\t\t\t}\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n  </file>\r\n\t\r\n\t<file path="admin/view/template/sale/order_form.twig">\r\n    \r\n\t\t<operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$(\'#option\').html(\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n\t\t\t\tif ( typeof(pcop_front) != \'undefined\' ) {\r\n\t\t\t\t\tpcop_front.init();\r\n\t\t\t\t\tpcop_front.updateDefaultValues();\r\n\t\t\t\t\tpcop_front.updateData(item[\'option\']);\r\n\t\t\t\t\tpcop_front.checkVisibility();\r\n\t\t\t\t}\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n  </file>\r\n  \r\n  <file path="catalog/controller/checkout/cart.php|catalog/controller/api/cart.php|catalog/controller/extension/module/quotation.php">\r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$product_options = $this->model_catalog_product->getProductOptions(\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        \r\n        // << Parent-child Options\r\n        if (isset($this->request->post[\'options_pcop_not_required\']) && $this->request->post[\'options_pcop_not_required\']) {\r\n          $pcop_not_required =  explode(\',\', $this->request->post[\'options_pcop_not_required\']);\r\n          \r\n          foreach ($product_options as &$product_option) {\r\n            if ( in_array($product_option[\'product_option_id\'], $pcop_not_required) ) {\r\n              $product_option[\'required\'] = false;\r\n\t\t\t\t\t\t\tunset($this->request->post[\'copu_product_id\'][$product_option[\'product_option_id\']]); // custom file upload\r\n            }\r\n          }\r\n          unset($product_option);\r\n        }\r\n        \r\n        // >> Parent-child Options\r\n        \r\n      ]]></add>\r\n    </operation>\r\n  </file>\r\n  \r\n</modification>', '1', '2018-03-19 20:11:20');
INSERT INTO `oc_modification` (`modification_id`, `extension_install_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('11', '14', 'LIVEOPENCART: Product Option Image PRO / Изображения опций PRO', 'liveopencart.poip', 'LIVEOPENCART (support@liveopencart.com / help@liveopencart.ru)', '3.0.2', 'http://liveopencart.com', '<?xml version="1.0" encoding="utf-8"?>\r\n<modification>\r\n\t<code>liveopencart.poip</code>\r\n  <name>LIVEOPENCART: Product Option Image PRO / Изображения опций PRO</name>\r\n  <version>3.0.2</version>\r\n  <author>LIVEOPENCART (support@liveopencart.com / help@liveopencart.ru)</author>\r\n  <link>http://liveopencart.com</link>\r\n  \r\n\t<file path="admin/controller/catalog/option.php" error="skip">\r\n\t\t\r\n    <!-- MODULE INSTALLED FLAG & MODULE ENTRIES-->\r\n    <operation >\r\n      <search><![CDATA[\r\n\t\t\t\tfunction getForm()\r\n      ]]></search>\r\n      <add position="after"><![CDATA[\r\n\t\t\t\t// Product Option Image PRO module <<\r\n\t\t\t\tliveopencart\\poip::initLibrary($this->registry);\r\n\t\t\t\t\r\n\t\t\t\t$data = array_merge( isset($data) ? $data : array(), $this->liveopencart_poip->getModel()->getOptionPageData() ) ;\r\n\r\n\t\t\t\t// >> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n    \r\n  </file>\r\n\t\r\n  <file path="admin/model/catalog/option.php" error="skip">\r\n  \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$this->db->query("DELETE FROM " . DB_PREFIX . "option_description\r\n      ]]></search>\r\n      <add position="after"><![CDATA[\r\n\t\t\t\t// Product Option Image PRO module <<\r\n\t\t\t\tliveopencart\\poip::initLibrary($this->registry);\r\n\t\t\t\t$this->liveopencart_poip->getModel()->deleteRealOptionSettings($option_id);\r\n\t\t\t\t// >> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n    \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\tif (isset($data[\'option_value\'])) {\r\n      ]]></search>\r\n      <add position="before"><![CDATA[\r\n\t\t\t\t// Product Option Image PRO module <<\r\n\t\t\t\tliveopencart\\poip::initLibrary($this->registry);\r\n\t\t\t\tif ( isset($data[\'poip_settings\']) ) {\r\n\t\t\t\t\t$this->liveopencart_poip->getModel()->setRealOptionSettings($option_id, $data[\'poip_settings\']);\r\n\t\t\t\t}\r\n\t\t\t\t// >> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n  </file>\r\n  \r\n  <file path="admin/view/template/catalog/option_form.twig">\r\n    \r\n    <operation >\r\n      <search><![CDATA[\r\n\t\t\t\t<table id="option-value" class="table table-striped table-bordered table-hover">\r\n\t\t\t]]></search>\r\n      <add position="before"><![CDATA[\r\n\t\t\t\t<!-- Product Option Image PRO module << -->\r\n\t\t\t\t{% if poip_installed ?? false %}\r\n\t\t\t\t\r\n\t\t\t\t\t<div class="form-group">\r\n\t\t\t\t\t\t<label class="col-sm-2 control-label" for="input-sort-order">{{ poip_module_name }}:</label>\r\n\t\t\t\t\t\t<div class="col-sm-10">\r\n\t\t\t\t\t\t\t<div class="row">\r\n\t\t\t\t\t\t\r\n\t\t\t\t\t\t\t\t{% for poip_setting in poip_settings_details %}\r\n\t\t\t\t\t\t\t\t\t<div class="col-sm-4">\r\n\t\t\t\t\t\t\t\t\t{{ poip_setting.title }}:\r\n\t\t\t\t\t\t\t\t\t<select name="poip_settings[{{ poip_setting.name }}]" class="form-control">\r\n\t\t\t\t\t\t\t\t\t\t{% if poip_setting.values %}\r\n\t\t\t\t\t\t\t\t\t\t\t<option value="0">{{ poip_settings_enable_disable_options[0] }}</option>\r\n\t\t\t\t\t\t\t\t\t\t\t{% for val_id, val_text in poip_setting.values %}\r\n\t\t\t\t\t\t\t\t\t\t\t\t<option value="{{ 1+val_id }}" \r\n\t\t\t\t\t\t\t\t\t\t\t\t\t{% if (poip_saved_settings[poip_setting.name] ?? 0) == (val_id+1) %}\r\n\t\t\t\t\t\t\t\t\t\t\t\t\t\tselected\r\n\t\t\t\t\t\t\t\t\t\t\t\t\t{% endif %}\r\n\t\t\t\t\t\t\t\t\t\t\t\t>{{ val_text }}</option>\r\n\t\t\t\t\t\t\t\t\t\t\t{% endfor %}\r\n\t\t\t\t\t\t\t\t\t\t{% else %}\r\n\t\t\t\t\t\t\t\t\t\t\t{% for poip_settings_enable_disable_option_value,poip_settings_enabl