n Image PRO module\r\n\t\t\t\t\r\n\t\t\t\t$this->liveopencart_poip = \\liveopencart\\poip::getLibrary($registry);\r\n\t\t\t\t\r\n\t\t\t\t// >> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n    <operation >\r\n\t\t\t<search><![CDATA[\r\n\t\t\t\t$product_data[] = array(\r\n\t\t\t]]></search>\r\n      <add position="before"><![CDATA[\r\n\t\t\t\t// << Product Option Image PRO module\r\n\t\t\t\t\r\n\t\t\t\t$product_query->row[\'image\'] = $this->liveopencart_poip->getModel()->getProductCartImage($product_query->row[\'product_id\'], $option_data, $product_query->row[\'image\']);\r\n\t\t\t\t\r\n\t\t\t\t// >> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n    \r\n  </file>\r\n\r\n\t\r\n\t\r\n</modification>', '1', '2018-03-19 20:11:51');
