INSERT INTO `oc_modification` (`modification_id`, `extension_install_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('6', '7', 'NitroPack', 'isense_nitropack', 'iSenseLabs', '3.5.11', 'http://isenselabs.com', '<?xml version="1.0" encoding="utf-8"?>\n<modification>\n    <code><![CDATA[isense_nitropack]]></code>\n    <name><![CDATA[NitroPack]]></name>\n    <version><![CDATA[3.5.11]]></version>\n    <author><![CDATA[iSenseLabs]]></author>\n    <link><![CDATA[http://isenselabs.com]]></link>\n\n    <!-- NitroPack PageCache -->\n    <file path="system/library/response.php">\n        <operation>\n            <search><![CDATA[public function addHeader(]]></search>\n            <add position="before"><![CDATA[\n                public function getHeaders() {\n                    return $this->headers;\n                }\n            ]]></add>\n        </operation>\n    </file>\n    <!-- End NitroPack PageCache -->\n\n    <!-- NitroPack DataBase interceptor -->\n    <file path="system/library/db.php">\n        <operation>\n            <search limit="1"><![CDATA[if (class_exists($class)) {]]></search>\n            <add position="before"><![CDATA[\n                $ds = DIRECTORY_SEPARATOR;\n                require_once DIR_SYSTEM . \'library\' . $ds . \'vendor\' . $ds . \'isenselabs\' . $ds . \'nitropack\' . $ds . \'config.php\';\n                require_once NITRO_CORE_FOLDER . \'nitro_db.php\';\n\n                $this->adaptor = NitroDb::getInstanceWithParams($adaptor, $hostname, $username, $password, $database, $port);\n                if ($this->adaptor) return;\n            ]]></add>\n        </operation>\n    </file>\n    <!-- End NitroPack DataBase interceptor -->\n\n    <!-- Journal compatibility -->\n    <file error="skip" path="catalog/view/theme/journal2/template/common/footer.tpl">\n        <operation error="skip">\n            <search><![CDATA[if ($user->isLogged())]]></search>\n            <add position="replace"><![CDATA[if ($user->isLogged() && function_exists(\'passesPageCacheValidation\') && !passesPageCacheValidation())]]></add>\n        </operation>\n    </file>\n\n    <file error="skip" path="catalog/view/theme/journal2/template/common/footer.tpl">\n        <operation error="skip">\n            <search><![CDATA[<?php if ($this->journal2->html_classes->hasClass(\'is-admin\')): ?>]]></search>\n            <add position="replace"><![CDATA[<?php if ($this->journal2->html_classes->hasClass(\'is-admin\') && function_exists(\'passesPageCacheValidation\') && !passesPageCacheValidation()): ?>]]></add>\n        </operation>\n    </file>\n    <!-- End Journal compatibility -->\n\n    <!-- ProductManager compatibility -->\n    <file path="admin/controller/catalog/productmanager.php">\n        <operation error="skip">\n            <search><![CDATA[$product_id   \t\t= $this->request->post[\'pid\'];]]></search>\n            <add position="after"><![CDATA[\n                $this->load->model(\'extension/module/nitro\');\n                $this->model_extension_module_nitro->clearProductCache($product_id);\n            ]]></add>\n        </operation>\n    </file>\n\n    <file path="admin/controller/catalog/productmanager.php">\n        <operation error="skip">\n            <search><![CDATA[$pid_info = $this->model_catalog_product->getProduct($pid);]]></search>\n            <add position="after"><![CDATA[\n                $this->load->model(\'extension/module/nitro\');\n                $this->model_extension_module_nitro->clearProductCache($pid);\n            ]]></add>\n        </operation>\n    </file>\n    <!-- End ProductManager compatibility -->\n\n    <!-- Compatibility with Bulk Product X-tra -->\n    <file error="skip" path="admin/model/catalog/product_extra.php">\n        <operation error="skip">\n            <search regex="true"><![CDATA[~.*?n (change|add|remove|update)\\w+\\(\\$product_id.*~]]></search>\n            <add position="replace">\n                <![CDATA[$0\n                $this->load->model(\'extension/module/nitro\');\n                $this->model_extension_module_nitro->clearProductCache($product_id);\n                ]]>\n            </add>\n        </operation>\n    </file>\n    <!-- End compatibility with Bulk Product X-tra -->\n\n    <!-- SEO MegaPack compatibility -->\n    <file path="catalog/controller/product/smp_image.php">\n        <operation>\n            <search limit="1"><![CDATA[header(\'Cache-Control: max-age=86400\');]]></search>\n            <add position="before"><![CDATA[\n                require_once NITRO_CORE_FOLDER . \'core.php\';\n                if (getNitroPersistence(\'BrowserCache.Images.Period\') != \'no-cache\') {\n                    $maxage = getNitroPersistence(\'BrowserCache.Images.Period\');\n                } else {\n                    $maxage = false;\n                }\n            ]]></add>\n        </operation>\n        <operation>\n            <search limit="1"><![CDATA[header(\'Expires: \'. gmdate(\'D, d M Y H:i:s \\G\\M\\T\', time() + 86400));]]></search>\n            <add position="after"><![CDATA[header(\'Last-Modified: Wed, 05 Jun 2009 06:40:46 GMT\');]]></add>\n        </operation>\n        <operation>\n            <search limit="1"><![CDATA[header(\'Cache-Control: max-age=86400\');]]></search>\n            <add position="replace"><![CDATA[header(\'Cache-Control: max-age=\' . (string)($maxage ? strtotime($maxage)-time() : 86400));]]></add>\n        </operation>\n        <operation>\n            <search limit="1"><![CDATA[header(\'Expires: \'. gmdate(\'D, d M Y H:i:s \\G\\M\\T\', time() + 86400));]]></search>\n            <add position="replace"><![CDATA[header(\'Expires: \'. gmdate(\'D, d M Y H:i:s \\G\\M\\T\', $maxage ? strtotime($maxage) : time() + 86400));]]></add>\n        </operation>\n    </file>\n    <!-- End SEO MegaPack compatibility -->\n\n    <!-- Image quality override -->\n    <file path="system/library/image.php">\n        <operation>\n            <search limit="1"><![CDATA[public function save($file, $quality = 90) {]]></search>\n            <add position="after"><![CDATA[\n                require_once NITRO_CORE_FOLDER . \'core.php\';\n                require NITRO_INCLUDE_FOLDER . \'image_quality_override.php\';\n            ]]></add>\n        </operation>\n    </file>\n    \n    <file path="catalog/model/tool/image.php">\n        <operation>\n            <search limit="1"><![CDATA[if ($width_orig != $width || $height_orig != $height) {]]></search>\n            <add position="before"><![CDATA[\n                $isNitroImageOverrideEnabled = getNitroPersistence(\'Enabled\') && getNitroPersistence(\'ImageCache.OverrideCompression\');\n            ]]></add>\n        </operation>\n        <operation>\n            <search limit="1"><![CDATA[if ($width_orig != $width || $height_orig != $height) {]]></search>\n            <add position="replace"><![CDATA[\n                if ($width_orig != $width || $height_orig != $height || $isNitroImageOverrideEnabled) {\n            ]]></add>\n        </operation>\n    </file>\n    <!-- End image quality override -->\n\n    <!-- Minifier hooks -->\n    <file path="system/library/document.php">\n        <operation>\n            <search limit="1"><![CDATA[return $this->styles;]]></search>\n            <add position="before"><![CDATA[\n                require_once NITRO_CORE_FOLDER . \'core.php\';\n                require_once NITRO_INCLUDE_FOLDER . \'minify_css.php\';\n\n                return nitro_minify_css($this->styles);\n            ]]></add>\n        </operation>\n        \n        <operation>\n            <search limit="1"><![CDATA[return $this->scripts[$postion];]]></search>\n            <add position="before"><![CDATA[\n                require_once NITRO_CORE_FOLDER . \'core.php\';\n                require_once NITRO_INCLUDE_FOLDER . \'minify_js.php\';\n\n                return nitro_minify_js($this->scripts[$postion]);\n            ]]></add>\n        </operation>\n    </file>\n    <!-- End minifier hooks -->\n\n    <!-- BeamStore jQuery from Google CDN -->\n    <file path="catalog/view/theme/beamstore/template/common/header.tpl">\n        <operation error="skip">\n            <search limit="1"><![CDATA[$lista_plikow[] = \'catalog/view/theme/\'.$config->get( \'config_template\' ).\'/js/jquery.min.js\';]]></search>\n            <add position="replace"><![CDATA[\n                if (getNitroPersistence(\'GoogleJQuery\')) {\n                    $lista_plikow[] = \'//ajax.googleapis.com/ajax/libs/jquery/2.1.1/jquery.min.js\';\n                } else {\n                    $lista_plikow[] = \'catalog/view/theme/\'.$config->get( \'config_template\' ).\'/js/jquery.min.js\';\n                }\n            ]]></add>\n        </operation>\n    </file>\n    <!-- End BeamStore jQuery from Google CDN -->\n</modification>\n', '1', '2018-03-04 11:59:59');
