\n                            } else {\r\n                                    html += \'<option value="0" selected="selected">{{ text_none }} </option>\';\r\n                            }\r\n\r\n                            $(\'#payment-new #input-payment-city\').html(html);\r\n                    },\r\n                    error: function(xhr, ajaxOptions, thrownError) {\r\n                            alert(thrownError + "\r\n" + xhr.statusText + "\r\n" + xhr.responseText);\r\n                    }\r\n            });\r\n        });\r\n       \r\n        });\r\n\r\n      ]]></add>\r\n        </operation>\r\n    </file>\r\n    <file path="catalog/view/theme/*/template/checkout/shipping_address.twig">\r\n        <operation error="skip">\r\n            <search><![CDATA[<label class="col-sm-2 control-label" for="input-shipping-city">{{ entry_city }}</label>]]></search>\r\n            <add position="replace" offset="3"><![CDATA[<div class="mmos-city"></div>]]></add>\r\n        </operation>\r\n        <operation error="skip">\r\n            <search><![CDATA[{% for custom_field in custom_fields %}]]></search>\r\n            <add position="before"><![CDATA[\r\n\t\t<div class="form-group required">\r\n\t\t    <label class="col-sm-2 control-label" for="input-shipping-city">{{ entry_city }}</label>\r\n\t\t    <div class="col-sm-10">\r\n\t\t      <select name="city" id="input-shipping-city" class="form-control">\r\n              </select>\r\n\t\t    </div>\r\n\t\t</div>\r\n        ]]></add>\r\n        </operation>\r\n        <operation error="skip">\r\n            <search><![CDATA[$(\'#collapse-shipping-address select[name=\\\'zone_id\\\']\').html(html);]]></search>\r\n            <add position="after" ><![CDATA[\r\n              $(\'#shipping-new  #input-shipping-zone\').trigger(\'change\');\r\n        ]]></add>\r\n        </operation>\r\n        <operation error="skip">\r\n            <search><![CDATA[$(\'.date\').datetimepicker({]]></search>\r\n            <add position="before"><![CDATA[\r\n             $( document ).ready(function() {   \r\n            $(document).on(\'change\', \'#shipping-new #input-shipping-zone\',  function() {\r\n            $.ajax({\r\n                    url: \'index.php?route=extension/module/city&zone_id=\' + this.value,\r\n                    dataType: \'json\',\r\n                    beforeSend: function() {\r\n                            $(\'#shipping-new  #input-shipping-zone\').after(\' <i class="fa fa-circle-o-notch fa-spin"></i>\');\r\n                    },\r\n                    complete: function() {\r\n                            $(\'.fa-spin\').remove();\r\n                    },\r\n                    success: function(json) {\r\n\r\n                    html = \'<option value="">{{ text_select }} </option>\';\r\n\r\n                            if (json[\'cities\'] && json[\'cities\'] != \'\') {\r\n                                    for (i = 0; i < json[\'cities\'].length; i++) {\r\n                                            html += \'<option value="\' + json[\'cities\'][i][\'name\'] + \'"\';\r\n\r\n                                            if (json[\'cities\'][i][\'name\'] == \'{{ city ? city : 0 }}\') {\r\n                                                    html += \' selected="selected"\';\r\n                                            }\r\n\r\n                                            html += \'>\' + json[\'cities\'][i][\'name\'] + \'</option>\';\r\n                                    }\r\n                            } else {\r\n                                    html += \'<option value="0" selected="selected">{{ text_none }} </option>\';\r\n                            }\r\n\r\n                            $(\'#shipping-new #input-shipping-city\').html(html);\r\n                    },\r\n                    error: function(xhr, ajaxOptions, thrownError) {\r\n                            alert(thrownError + "\r\n" + xhr.statusText + "\r\n" + xhr.responseText);\r\n                    }\r\n            });\r\n        });\r\n       \r\n        });\r\n      ]]></add>\r\n        </operation>\r\n    </file>\r\n    <file path="admin/controller/common/column_left.php">\r\n        <operation>\r\n            <search><![CDATA[$tax = array();]]></search>\r\n            <add position="after"><![CDATA[\r\n                $this->load->model(\'extension/module/city\');\r\n        \r\n                $existed = $this->model_extension_module_city->CheckInstall();\r\n\t\t                \r\n                if ($this->user->hasPermission(\'access\', \'extension/module/city\')) {\r\n                    if($existed){\r\n                            $localisation[] = array(\r\n                                            \'name\'\t   => "Cities",\r\n                                            \'href\'     => $this->url->link(\'extension/module/city\', \'user_token=\' . $this->session->data[\'user_token\'], true),\r\n                                            \'children\' => array()\r\n                            );\r\n                    } else {\r\n                     $localisation[] = array(\r\n                                            \'name\'\t   => "Install Cities Module",\r\n                                            \'href\'     => $this->url->link(\'extension/module/city/install\', \'user_token=\' . $this->session->data[\'user_token\'], true),\r\n                                            \'children\' => array()\r\n                            );\r\n                    }\r\n                }\r\n                \r\n            ]]></add>\r\n        </operation>\r\n    </file>\r\n</modification>', '1', '2018-03-21 18:05:08');
INSERT INTO `oc_modification` (`modification_id`, `extension_install_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('10', '13', 'Parent-child Options (Journal2 theme)', 'parent-child-options-journal2', 'LIVEOPENCART (support@liveopencart.com)', '3.0.2', 'http://liveopencart.com', '<?xml version="1.0" encoding="utf-8"?>\r\n<modification>\r\n\t<code>parent-child-options-journal2</code>\r\n  <name>Parent-child Options (Journal2 theme)</name>\r\n  <version>3.0.2</version>\r\n  <author>LIVEOPENCART (support@liveopencart.com)</author>\r\n  <link>http://liveopencart.com</link>\r\n  \r\n  <file path="catalog/controller/journal2/quickview.php"> \r\n    \r\n\t\t<operation>\r\n      <search><![CDATA[\r\n\t\t\t\tpublic function index(\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n\t\t\t\t\r\n\t\t\t\tif ( !$this->parent_child_options_common ) {\r\n\t\t\t\t\t$this->load->library(\'liveopencart/parent_child_options_common\');\r\n\t\t\t\t}\r\n\t\t\t\tif ( $this->parent_child_options_common->installed() ) {\r\n\t\t\t\t\t$this->journal2->minifier->addScript($this->parent_child_options_common->getProductPageScriptPath());\r\n\t\t\t\t}\r\n        \r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\tforeach ($this->model_catalog_product->getProductOptions(\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n        if ( !isset($pcop_data) ) $pcop_data = array();\r\n        $pcop_data[$option[\'product_option_id\']] = isset($option[\'pcop_front\']) ? $option[\'pcop_front\'] : array();\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$data[\'reviews\']\r\n\t\t\t]]></search>\r\n      <add position="before"><![CDATA[\r\n        // << Parent-child Options\r\n        $data[\'pcop_data\'] = !empty($pcop_data) ? $pcop_data : array();\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t$data[\'product_id\'] =\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n\t\t\t\tif ( !$this->parent_child_options_common ) {\r\n\t\t\t\t\t$this->load->library(\'liveopencart/parent_child_options_common\');\r\n\t\t\t\t}\r\n        $data[\'pcop_theme_name\'] = $this->parent_child_options_common->getThemeName();\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n  </file>\r\n  \r\n\t<!--\r\n  <file path="catalog/model/catalog/product.php">\r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\tpublic function getProduct($product_id) {\r\n\t\t\t]]> </search>\r\n      <add position="before"><![CDATA[\r\n        // << Parent-child Options\r\n        function pcop_front_getProductOptionParents($product_option_id) {\r\n\t\t\t\t\tif ( !$this->parent_child_options_common ) {\r\n\t\t\t\t\t\t$this->load->library(\'liveopencart/parent_child_options_common\');\r\n\t\t\t\t\t}\r\n\t\t\t\t\treturn $this->parent_child_options_common->getProductOptionFrontParents($product_option_id);\r\n\t\t\t\t}\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t\'product_option_id\'    => $product_option[\'product_option_id\'],\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n        // << Parent-child Options\r\n        \'pcop_front\'    => $this->pcop_front_getProductOptionParents($product_option[\'product_option_id\']),\r\n        // >> Parent-child Options\r\n      ]]></add>\r\n    </operation>\r\n    \r\n  </file>\r\n\t-->\r\n\r\n\t<file path="catalog/view/theme/*/template/journal2/quickview/quickview.twig">\r\n    <operation>\r\n      <search><![CDATA[\r\n\t\t\t\t</body>\r\n\t\t\t]]></search>\r\n      <add position="before"><![CDATA[\r\n        {% if ( pcop_data ?? false ) %}\r\n\t\t\t\t\t<!-- << Parent-child Options -->\r\n\t\t\t\t\t<script type="text/javascript"><!--\r\n\t\t\t\t\t\r\n\t\t\t\t\t\tvar pcop_data = {{ (pcop_data ?? 0) ? pcop_data|json_encode : \'[]\' }};\r\n\t\t\t\t\t\tvar pcop_theme_name = \'{{ pcop_theme_name ?? \'\' }}\';\r\n\t\t\t\t\t\t\r\n\t\t\t\t\t\tif ( typeof(pcop_front) != \'undefined\' ) {\r\n\t\t\t\t\t\t\tpcop_front.init(pcop_data, pcop_theme_name);\r\n\t\t\t\t\t\t}\r\n\t\t\t\t\t\r\n\t\t\t\t\t//--></script>\r\n\t\t\t\t\t<!-- >> Parent-child Options -->\r\n        {% endif %}\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n  </file>\r\n  \r\n</modification>', '1', '2018-03-19 20:11:31');
INSERT INTO `oc_modification` (`modification_id`, `extension_install_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('12', '15', 'LIVEOPENCART: Product Option Image PRO (Journal2)', 'liveopencart.poip.journal2', 'LIVEOPENCART (support@liveopencart.com)', '3.0.1', 'http://liveopencart.com', '<?xml version="1.0" encoding="utf-8"?>\r\n<modification>\r\n\t<code>liveopencart.poip.journal2</code>\r\n  <name>LIVEOPENCART: Product Option Image PRO (Journal2)</name>\r\n  <version>3.0.1</version>\r\n  <author>LIVEOPENCART (support@liveopencart.com)</author>\r\n  <link>http://liveopencart.com</link>\r\n\t\r\n\t<file path="catalog/controller/journal2/quickview.php" error="skip">  \r\n    \r\n    <operation error="skip">\r\n      <search ><![CDATA[\r\n\t\t\t\t$data[\'images\'][] = array(\r\n      ]]></search>\r\n      <add position="after"><![CDATA[\r\n\t\t\t\t// << Product Option Image PRO module\r\n\t\t\t\t\'title\' => isset($result[\'title\']) ? $result[\'title\'] : \'\',\r\n\t\t\t\t// >> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n    <operation error="skip">\r\n\t\t\t<search><![CDATA[\r\n\t\t\t\t$results = $this->model_catalog_product->getProductImages(\r\n\t\t\t]]></search>\r\n      <add position="after"><![CDATA[\r\n\t\t\t\t// << << Product Option Image PRO module\r\n\r\n\t\t\t\tliveopencart\\poip::initLibrary($this->registry);\r\n\t\t\t\t$poip_scripts = array_merge( $this->liveopencart_poip->getModel()->getHeaderScripts(), $this->liveopencart_poip->getModel()->getProductPageScripts() );\r\n\t\t\t\tforeach ($poip_scripts as $poip_script) {\r\n\t\t\t\t\t$this->journal2->minifier->addScript($poip_script);\r\n\t\t\t\t}\r\n\t\t\t\t$poip_data = $this->liveopencart_poip->getModel()->getDataForProductPage($this->request->get[\'pid\'], $results);\r\n\t\t\t\tif ( $poip_data ) {\r\n\t\t\t\t\t$data = array_merge($data, $poip_data[\'data\']);\r\n\t\t\t\t\t$results = $poip_data[\'results\'];\r\n\t\t\t\t}\r\n\t\t\t\r\n\t\t\t\t//>> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n\t\t<!-- Images for Checkboxes -->\r\n\t\t<operation error="skip">\r\n\t\t\t<search><![CDATA[\r\n\t\t\t\t$product_option_value_data[] = array(\r\n\t\t\t]]></search>\r\n\t\t\t<add position="after"><![CDATA[\r\n\t\t\t\t// << Product Option Image PRO module\r\n\t\t\t\t\'poip_image\' => $this->liveopencart_poip->getModel()->getProductOptionValuePOIPThumbResized($option_value[\'poip_image\']),\r\n\t\t\t\t// >> Product Option Image PRO module\r\n\t\t\t]]></add>\r\n\t\t</operation>\r\n\t\t\r\n  </file>\r\n\t\r\n\t<file path="catalog/view/theme/*/template/journal2/quickview/quickview.twig">\r\n\t\t\r\n    <operation error="skip">\r\n      <search regex="true"><![CDATA[~src="{{ image\\.thumb }}" title="{{ heading_title }}" alt="{{ heading_title }}"~]]></search>\r\n      <add><![CDATA[src="{{ image.thumb }}" title="{{ image.title ?? heading_title }}" alt="{{ image.title ?? heading_title }}"]]></add>\r\n    </operation>\r\n\t\t\r\n\t\t<!-- Images for Checkboxes -->\r\n\t\t<operation error="skip">\r\n\t\t\t<search><![CDATA[\r\n\t\t\t\t<input type="checkbox" name="option\r\n\t\t\t]]></search>\r\n\t\t\t<add position="after"><![CDATA[\r\n\t\t\t\t{# // << Product Option Image PRO module #}\r\n\t\r\n\t\t\t\t{% if option[\'type\'] == \'checkbox\' and (option_value[\'poip_image\'] ?? false ) %}\r\n\t\t\t\t\t<img src="{{ option_value[\'poip_image\'] }}" alt="{{ option_value[\'name\'] }}{{ (option_value[\'price\'] ? \' \'~option_value[\'price_prefix\']~option_value[\'price\'] : \'\') }} " class="img-thumbnail" /> \r\n\t\t\t\t{% endif %}\r\n\t\t\t\t\r\n\t\t\t\t{# // >> Product Option Image PRO module #}\r\n\t\t\t]]></add>\r\n\t\t</operation>\r\n\t\t\r\n\t\t<!-- SCRIPT -->\r\n    <operation > \r\n      <search><![CDATA[</body>]]></search>\r\n\t\t\t\r\n      <add position="before"><![CDATA[\r\n\t\t\t\t<!-- << Product Option Image PRO module -->\r\n\t\t\t\t{% if poip_installed ?? false %}\r\n\t\t\t\t\t<script  type = "text/javascript" ><!--\r\n\t\t\t\t\t\t(function(){\r\n\t\t\t\t\t\t\tvar poip_product_settings = {\r\n\t\t\t\t\t\t\t\tproduct_option_ids \t: {{ poip_product_option_ids|json_encode }},\r\n\t\t\t\t\t\t\t\timages \t\t\t\t\t\t\t: {{ poip_images|json_encode }},\r\n\t\t\t\t\t\t\t\timages_by_povs\t\t\t: {{ poip_images_by_povs|json_encode }},\r\n\t\t\t\t\t\t\t\tmodule_settings \t\t: {{ poip_settings|json_encode }},\r\n\t\t\t\t\t\t\t\toptions_settings \t\t: {{ poip_product_settings|json_encode }},\r\n\t\t\t\t\t\t\t\tpoip_ov \t\t\t\t\t\t: {{ poip_ov ?? 0 }},\r\n\t\t\t\t\t\t\t\tdefault_image_title : \'{{ heading_title }}\',\r\n\t\t\t\t\t\t\t};\r\n\t\t\t\t\t\t\r\n\t\t\t\t\t\t\tvar poip_product = getPoipProduct();\r\n\t\t\t\t\t\t\tif ( setPoipProductCustomMethods ) {\r\n\t\t\t\t\t\t\t\tsetPoipProductCustomMethods(poip_product);\r\n\t\t\t\t\t\t\t}\r\n\t\t\t\t\t\t\t\r\n\t\t\t\t\t\t\tpoip_common.initObject(poip_product, poip_product_settings);\r\n\t\t\t\t\t\t})();\r\n\t\t\t\t\t//--></script>\r\n\t\t\t\t{% endif %}\r\n\t\t\t\t\r\n      <!-- >> Product Option Image PRO module -->\r\n      ]]></add>\r\n    </operation>\r\n    \r\n  </file>\r\n\t\r\n\t<file path="catalog/controller/module/journal2_custom_sections.php|catalog/controller/module/journal2_carousel.php|catalog/controller/module/journal2_super_filter.php" error="skip">\r\n\t\t\r\n\t\t<operation error="skip">\r\n      <search regex="true"><![CDATA[\r\n\t\t\t\t~(\\$this->template = ["\']journal2/module/)(carousel|custom_sections|super_filter_product)~\r\n      ]]></search>\r\n      <add>\r\n\t\t\t\t<![CDATA[\r\n\t\t\t\t\t// << Product Option Image PRO module\r\n\t\t\t\t\tliveopencart\\poip::initLibrary($this->registry);\r\n\t\t\t\t\t\r\n\t\t\t\t\t$this->data[\'poip_installed\'] \t= $this->liveopencart_poip->installed();\r\n\t\t\t\t\t$this->data[\'poip_theme_name\'] \t= $this->liveopencart_poip->getModel()->getThemeName();\r\n\t\t\t\t\t\r\n\t\t\t\t\t// >> Product Option Image PRO module\r\n\t\t\t\t$1$2]]>\r\n\t\t\t</add>\r\n    </operation>\r\n\t\t\r\n\t\t<operation error="skip">\r\n      <search><![CDATA[\r\n\t\t\t\t\'product_id\'  => $result[\'product_id\'],\r\n      ]]></search>\r\n      <add position="after"><![CDATA[\r\n\t\t\t\t// << Product Option Image PRO module\r\n\t\t\t\t\'poip_images\'  => $this->liveopencart_poip->getModel()->getCategoryImagesForController( $result[\'product_id\'], (isset($setting) ? $setting : false) ),\r\n\t\t\t\t// >> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n\t\t<!-- filter -->\r\n\t\t<operation error="skip">\r\n      <search><![CDATA[\r\n\t\t\t\t\'product_id\'    => $product[\'product_id\'],\r\n      ]]></search>\r\n      <add position="after"><![CDATA[\r\n\t\t\t\t// << Product Option Image PRO module\r\n\t\t\t\t\'poip_images\'  => $this->liveopencart_poip->getModel()->getCategoryImagesForController( $product[\'product_id\'], (isset($setting) ? $setting : false) ),\r\n\t\t\t\t// >> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n\t\t<operation error="skip">\r\n      <search><![CDATA[\r\n\t\t\t\t$image2 = Journal2Utils::resizeImage($this->model_tool_image, $results[0][\'image\']\r\n      ]]></search>\r\n      <add position="after"><![CDATA[\r\n\t\t\t\t// << Product Option Image PRO module\r\n\t\t\t\t\r\n\t\t\t\tif ( count($results) > 1 && $image2 == $image) {\r\n\t\t\t\t\t$image2 = Journal2Utils::resizeImage($this->model_tool_image, $results[1][\'image\'] ? $results[1][\'image\'] : \'data/journal2/no_image_large.jpg\', $this->data[\'image_width\'], $this->data[\'image_height\'], $this->data[\'image_resize_type\']);\r\n\t\t\t\t}\r\n\t\t\t\t\r\n\t\t\t\t// >> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n\t\t<!-- filter -->\r\n\t\t<operation error="skip">\r\n      <search><![CDATA[\r\n\t\t\t\t$image2 = $this->model_tool_image->resize($results[0][\'image\']\r\n      ]]></search>\r\n      <add position="after"><![CDATA[\r\n\t\t\t\t// << Product Option Image PRO module\r\n\t\t\t\t\r\n\t\t\t\tif ( count($results) > 1 && $image2 == $image) {\r\n\t\t\t\t\t$image2 = Journal2Utils::resizeImage($this->model_tool_image, $results[1][\'image\'] ? $results[1][\'image\'] : \'data/journal2/no_image_large.jpg\', $this->data[\'image_width\'], $this->data[\'image_height\'], $this->data[\'image_resize_type\']);\r\n\t\t\t\t}\r\n\t\t\t\t\r\n\t\t\t\t// >> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n\t</file>\r\n\t\r\n\t<file path="catalog/view/theme/*/template/journal2/module/carousel_product.twig|catalog/view/theme/*/template/journal2/module/custom_sections_product.twig||catalog/view/theme/*/template/journal2/module/super_filter_product.twig" error="skip">  \r\n    \r\n    <operation error="skip">\r\n      <search regex="true"><![CDATA[~(src="{{ product.thumb }}")~]]></search>\r\n      <add><![CDATA[$1 data-poip-product-id="{{ product[\'product_id\'] }}" {% if product.poip_images ?? false %} data-poip-images="{{ product.poip_images|json_encode|e }}" {% endif %} ]]></add>\r\n    </operation>\r\n    \r\n\t</file>\r\n\r\n\t<file path="catalog/controller/checkout/cart.php" error="skip">  \r\n    \r\n    <operation error="skip">\r\n      <search ><![CDATA[\r\n\t\t\t\t$json[\'image\'] = Journal2Utils::resizeImage($this->model_tool_image, $product_info[\'image\']\r\n      ]]></search>\r\n      <add position="before"><![CDATA[\r\n\t\t\t\t// << Product Option Image PRO module\r\n\t\t\t\tliveopencart\\poip::initLibrary($this->registry);\r\n\t\t\t\t$poip_options = array();\r\n\t\t\t\tforeach ($option as $po_id => $pov_id) {\r\n\t\t\t\t\t$poip_options[] = array(\'product_option_id\'=>$po_id, \'product_option_value_id\'=>$pov_id);\r\n\t\t\t\t}\r\n\t\t\t\t$product_info[\'image\'] = $this->liveopencart_poip->getModel()->getProductCartImage((int)$product_info[\'product_id\'], $poip_options, $product_info[\'image\']);\r\n\t\t\t\t// >> Product Option Image PRO module\r\n      ]]></add>\r\n    </operation>\r\n\t\t\r\n\t</file>\r\n\t\r\n</modification>\r\n\t\t', '1', '2018-03-19 20:11:56');
